import React from "react";

function AppIntro() {
  return (
    <div class="app__intro">
      <h1> Hello Yellow! </h1> <p> We are all living in a yellow submarine </p>
      <ul>
        <li> you </li>
        <li> me </li>
        <li> he or she </li>
      </ul>
    </div>
  );
}

export default AppIntro;
